import React from "react";
import sdata from "./Sdata.jsx";

function Cards() {
  return (
    <div className="grid">
      {sdata.map((item, index) => (
        <div class="grid__item" key={index}>
          <div class="card">
            <img class="card__img" src={item.imgsrc} alt="Snowy Mountains" />
            <div class="card__content">
              <h3 class="card__header">{item.sname}</h3>
              <p class="card__text">{item.title}</p>
              <button class="card__btn">
                Explore <span>&rarr;</span>
              </button>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Cards;
